    false,nt"url": null,nt"notes": "This report presents the results of a duck
    production study at Fish Springs National Wildlife Refuge. Nest dragging was initiated
    on the refuge for the first time in 1989, using an adapted version of the Mayfield
    Exposure Method to collect data to determine nest success. Pair counts and brood
    data was also used with nest success to determine overall production.  Survey results,
